Mono makes it trivially easy to create a new App Domain, all we have to do is call mono_domain_create_appdomain and give our App Domain a name. Remember to store the MonoDomain pointer returned by this function somewhere, we'll need it later on. This process will become slightly more complicated in the future but for now we'll just modify our initalization function to look like this: void InitMono()
{ mono_set_assemblies_path("mono/lib"); MonoDomain* rootDomain = mono_jit_init("MyScriptRuntime"); if (rootDomain == nullptr) { // Maybe log some error here return; } // Store the root domain pointer s_RootDomain = rootDomain; // Create an App Domain s_AppDomain = mono_domain_create_appdomain("MyAppDomain", nullptr); mono_domain_set(s_AppDomain, true);
} You may wonder what the second parameter of mono_domain_create_appdomain is, well it allows us to pass a path to a configuration file. We won't be needing this so we can simply pass nullptr. Once we've got our MonoDomain pointer we have to set our new App Domain to be the current App Domain, we can do this by calling mono_domain_set and pass our domain. The second parameter simply indicates if we want to force our domain to be set as the current domain. In reality we could probably pass false here since all that parameter does is forcibly set the App Domain even if it's being unloaded, but we'll just go ahead and pass true. Now that we've created our AppDomain we can finally start working towards running C# code from C++! All we have to do now is load a C# assembly, which we'll cover in the next section.

