Alright that sounds good in theory, but how do we do that? Well it's surprisingly easy, although the code can look a bit complicated at first. void PrintAssemblyTypes(MonoAssembly* assembly)
{ MonoImage* image = mono_assembly_get_image(assembly); const MonoTableInfo* typeDefinitionsTable = mono_image_get_table_info(image, MONO_TABLE_TYPEDEF); int32_t numTypes = mono_table_info_get_rows(typeDefinitionsTable); for (int32_t i = 0; i < numTypes; i++) { uint32_t cols[MONO_TYPEDEF_SIZE]; mono_metadata_decode_row(typeDefinitionsTable, i, cols, MONO_TYPEDEF_SIZE); const char* nameSpace = mono_metadata_string_heap(image, cols[MONO_TYPEDEF_NAMESPACE]); const char* name = mono_metadata_string_heap(image, cols[MONO_TYPEDEF_NAME]); printf("%s.%s", nameSpace, name); }
}

