So in order for us to call methods and access properties on a C# class from C++ we first have to get a reference to that class, and create an instance of it. There are many ways of getting a reference to a C# class but the simplest is by making use of the mono_class_from_name function, which lets us get a class by name. So lets say we want to get a reference to our CSharpTesting class, in that case our code would look something like this: MonoClass* GetClassInAssembly(MonoAssembly* assembly, const char* namespaceName, const char* className)
{ MonoImage* image = mono_assembly_get_image(assembly); MonoClass* klass = mono_class_from_name(image, namespaceName, className); if (klass == nullptr) { // Log error here return nullptr; } return klass;
} // ... MonoClass* testingClass = GetClassInAssembly(appAssembly, "", "CSharpTesting");
